import React, { Component } from "react";
import "../../../App.css";
import { Link } from "react-router-dom";
class Navadmin extends Component {
  clicKed = () => {
    var x = document.getElementById("navba");
    if (x.className === "topnav") {
      x.className = "topnav responsive";
    } else {
      x.className = "topnav";
    }
  };

  render() {
    return (
      <nav
        className="navbar navbar-expand-sm fixed-top navbar-light rounded"
        style={{ backgroundColor: "white" }}
      >
        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon"></span>
        </button>

        <div
          className="collapse navbar-collapse justify-content-md-center"
          id="navbarSupportedContent"
          style={{ fontSize: "18px" }}
        >
          <ul className="navbar-nav">
            <Link className="nav-link" to="/">
              Trang chủ
            </Link>
            <Link className="nav-link" to="/admin/quanlysanpham">
              Quản lý sản phẩm
            </Link>
            <Link className="nav-link" to="/admin/quanlydonhang">
              Quản lý đơn hàng
            </Link>
            <Link className="nav-link" to="/admin/quanlymenu">
              Quản lý menu
            </Link>
            <Link className="nav-link" to="/admin/login">
              Đăng nhập
            </Link>
          </ul>
        </div>
      </nav>
    );
  }
}

export default Navadmin;
